import './Header.css';

export default function Header() {
    return (
        <div className="navigationbar">
            <p class="active">About me</p>
            <p>My skills</p>
            <p>Library</p>
            <p>Miniatures</p>
            <p>Contacts</p>
        </div>
    );
}
